import React from "react";
import { Link } from "react-router-dom";
import "./FoodMenu.css";

function MenuList({ items, title, itemType }) {
  return (
    <div>
      <h1>{title}</h1>
      <ul>
        {items.map(item => (
          <li key={item.id}>
            <Link to={`/${itemType}/${item.id}`}>{item.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default MenuList;
